import React from "react";
import  ReactDOM  from "react-dom";
import Parent from "./props/Parent";
import GuesList from "./state/GuesList";

const App=()=>{
    return(

        <>
       <Parent/>
       <GuesList/>
        </>
    )
}


ReactDOM.render(
    <App/>,document.querySelector("#root")
)
